import React, { Component } from "react";
import "./index.css";
export default class Header extends Component {
  handleKeyUp = (e) => {
    console.log(e.target.value);
  };
  render() {
    return (
      <div className="header">
        <div className="input">
          <input type="text" onKeyUp={this.handleKeyUp} />
        </div>
        <button>+</button>
      </div>
    );
  }
}
